using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;
using System.Web.Mvc;
using System.IO;
using System.Drawing;

namespace DesktopServer.Controllers
{
    public class HomeController : Controller
    {
        //String s = "";
        public string Index()
        {
            string errormessage = "Success!";
            Stream stream = Request.InputStream;
            BufferedStream buffered = new BufferedStream(stream);
            byte[] bytes = new byte[buffered.Length];
            buffered.Read(bytes, 0, bytes.Length);
            string base64string = System.Text.Encoding.Default.GetString(bytes);

           
            try
            {
                byte[] bitmapData = Convert.FromBase64String(base64string);

                using (MemoryStream memory = new MemoryStream(bitmapData))
                {
                    try
                    {
                        Image image = Image.FromStream(memory);
                        image.Save("D:\\coolstuff.jpg", System.Drawing.Imaging.ImageFormat.Jpeg);

                    }
                    catch (Exception e) { errormessage = "Request body was not an image."; }
                }
            }
            catch (Exception e) { errormessage = "Request body was not a base 64 string"; }
            return errormessage;
        }
    }
}